import React from 'react';

function HomePage() {
  return (
    <div className="container">
      <h1>Welcome to My Hacker Den</h1>
      <p>
        In the vast expanse of cyberspace, I explore vulnerabilities, push boundaries, 
        and strive to understand the art of penetration testing and ethical hacking.
      </p>
      <p>
        While the line between white-hat and black-hat hacking is thin, I firmly stand 
        on the side of ethics and cybersecurity. Understanding the tactics of malicious actors 
        (black-hat hackers) allows us to fortify defenses and safeguard systems.
      </p>
      <p>
        This site is my personal hub, where tech meets curiosity and innovation. Feel free to explore!
      </p>
    </div>
  );
}

export default HomePage;
